  gray: {
    300: "hsla(190, 5%, 80%, 1)",
    500: "hsla(196, 4%, 60%, 1)",
    900: "hsla(220, 3%, 20%, 1)",
  },
  white: "hsla(0, 0%, 100%, 1)",
};

export const WEIGHTS = {
  normal: 500,
  medium: 600,
  bold: 800,
};
